import { useNavigate } from 'react-router-dom';
import './Dashboard.css'; // Import CSS

function Dashboard() {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  const movies = [
    { title: "The Shawshank Redemption", description: "Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency." },
    { title: "The Godfather", description: "The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son." },
    { title: "The Dark Knight", description: "Batman faces the Joker, a criminal mastermind who plunges Gotham City into chaos." },
    { title: "Pulp Fiction", description: "The lives of two mob hitmen, a boxer, and a pair of diner bandits intertwine in tales of violence and redemption." },
    { title: "Inception", description: "A skilled thief is given a chance at redemption if he can successfully perform inception: planting an idea into someone's mind." },
    { title: "Forrest Gump", description: "The story of a simple man who inadvertently influences some of the major historical events of the 20th century." },
    { title: "Fight Club", description: "An office worker and a devil-may-care soapmaker form an underground fight club that evolves into much more." },
    { title: "Interstellar", description: "A team of explorers travel through a wormhole in space in an attempt to ensure humanity's survival." },
    { title: "The Matrix", description: "A computer hacker learns the true nature of his reality and his role in the war against its controllers." },
    { title: "Gladiator", description: "A former Roman general seeks revenge against the corrupt emperor who murdered his family." },
    { title: "The Lord of the Rings: The Fellowship of the Ring", description: "A meek Hobbit and eight companions set out on a journey to destroy the One Ring and the Dark Lord Sauron." },
    { title: "The Lion King", description: "A lion prince flees his kingdom only to learn the true meaning of responsibility and bravery." },
    { title: "Saving Private Ryan", description: "Captain John Miller must lead his men behind enemy lines to find Private James Ryan during World War II." },
    { title: "Avengers: Endgame", description: "After the devastating events of Infinity War, the Avengers assemble once more to reverse Thanos' actions." },
    { title: "Joker", description: "In Gotham City, a mentally troubled comedian descends into a downward spiral of crime and chaos." }
  ];

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Welcome to Your Dashboard</h1>
        <button onClick={handleLogout} className="dashboard-button">Logout</button>
      </div>
      <div className="movies-list">
        {movies.map((movie, index) => (
          <div key={index} className="movie-card">
            <h2 className="movie-title">{movie.title}</h2>
            <p className="movie-description">{movie.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Dashboard;
